description:
"Deutsche Dogge" is German for Great Dane, a large breed of mastiff hound; It is, in fact, one of the largest dog breeds in the world.
Strong, long-legged dogs were often imported from the British Isles by European nobilities to use as hunting/catch dogs and chamber dogs. One of these breeds was the "Englische Dogge", later renamed by a German committee to "Deutsche Dogge".
In the late nineteenth century the dogs were sometimes known as Reichshund (empire dog) because of their association with the Reichskanzler, Otto von Bismarck.

dogs in the great war - Although difficult to estimate the exact numbers, we know that all armies involved in the war used dogs for military purposes:
- Larger dogs hauled machineguns and supply sleds;
- Some served in the medical corps, either locating the wounded and waiting by their side until further help arrived or bringing back proof of survival;
- Dogs operated as messengers, delivering vital information fearlessly even under fire;
- Smaller dogs were used as rat catchers in the trences: rats were a scourge in the trenches and hunting them down was fundemental to life on the frontlines.
- Dog ownership increased overall soldier morale.
Some famous dogs include Moritz, the Red Baron's lap dog, and Rin Tin Tin, an abandoned German Shepherd adopted by an American soldier.

"The König" (German for King) is a possible reference to the König-class battleships employed by the German high seas fleet. 
Four of these König-class dreadnoughts were built:
- König, the lead ship from which the designation takes its name;
- Grosser Kurfürst;
- Markgraf;
- Kronprinz, whose name probably inspired a skin for the Selbstlader 1916.
All four ships took part in several raids in the North Sea as well as the much bigger battle of Jutland in 1916.
